import React from 'react';
import './Article.css';

const headline = 'Rats Orchestrate Takeover of New York City';
const author = 'Bernard Mendez';
const link = 'https://dailybruin.com';

function Article() {

  function newTab(e) {
    window.open(e);
  }

  return (
    <div className='Article'>
      <div>
        <div class='img'></div>
      </div>

      <div className='headline' onClick={newTab(link)}>
        <h3>
        <a href=''>
          {headline}
        </a>
        </h3>
        <h4>By {author}</h4>
      </div>
    </div>
  );
}


export default Article;
